import React from 'react';

const Error = () => {
    return(
        <div className='content-wrapper'>
            <div class="text-center pt-4">
                <img src="{{ asset('frontend/images/no-rev.png') }}" alt="" class="img-rev"/>
                    <p>
                    Oops! 
                    </p>
            </div>
        </div>
    )
}

export default Error;
